/*Table structure for table `becas_1718` */

DROP TABLE IF EXISTS `becas_1718`;

CREATE TABLE `becas_1718` (
  `id_beca` int(10) unsigned NOT NULL DEFAULT '0',
  `folio` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'folio de la solicitud cicloinicial+ciclofinal+consecutivo',
  `matricula` varchar(6) DEFAULT '' COMMENT 'matricula del alumno (queda en blanco si es externo)',
  `porc_beca` int(3) NOT NULL DEFAULT '0' COMMENT 'porcentaje actual de la beca',
  `tipo_sol` varchar(1) NOT NULL DEFAULT '' COMMENT 'abreviaturas del tipo de solicitud',
  `estatus` varchar(3) NOT NULL DEFAULT '' COMMENT 'estatus de la beca (comprometida, solicitada etc)',
  `sta` int(1) NOT NULL DEFAULT '1' COMMENT 'estatus del registro (1 activo,0 inactivo)',
  `domicilio` varchar(100) DEFAULT '' COMMENT 'domicilio del alumno externo',
  `telefono` varchar(30) DEFAULT '' COMMENT 'telefono del alumno externo',
  `prom_aca` decimal(10,2) NOT NULL DEFAULT '0.00',
  `prom_con` decimal(10,2) NOT NULL DEFAULT '0.00',
  `nombre` varchar(50) DEFAULT '' COMMENT 'nombre completo del alumno',
  `nivel` varchar(3) DEFAULT '',
  `colegio_proc` varchar(50) DEFAULT '' COMMENT 'colegio de procedencia del alumno',
  `tipo_beca` varchar(30) DEFAULT '' COMMENT 'tipo de beca solicitada',
  `grado` int(1) DEFAULT '0' COMMENT 'grado del alumno',
  `origen_beca` varchar(30) DEFAULT '' COMMENT 'especifica la empresa de donde viene la beca',
  `porc_actual` decimal(10,2) DEFAULT '0.00',
  `porc_prestacion` decimal(10,2) DEFAULT '0.00',
  `origen_beca2` varchar(20) DEFAULT '',
  `motivo` varchar(100) DEFAULT ''
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

