  `telefono` varchar(10) NOT NULL DEFAULT '' COMMENT 'telefono del contacto de la empresa',
  `porcentaje` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT 'porcentaje de otorgado por colegio andes para dicha empresa',
  `estatus` int(1) NOT NULL DEFAULT '1' COMMENT 'estatus de la empresa (1=activo,0=inactivo)',
