  `alerta` int(1) DEFAULT '0' COMMENT 'Especifica si la empresa es del grupo alerta',
  PRIMARY KEY (`id_empresa`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;

